 
 --EXPANSION DE DATOS
 USE FastFoodDB;
 

























--CONSULTAS ESTRATEGICAS
--Analisis de la actividad de ventas por horario

 SELECT 
	HorarioVenta, 
	SUM(TotalCompra) AS 'Volumen de Ventas',  -- En dinero
	COUNT(*) AS 'Cantidad de Ventas',
	CAST(AVG(TotalCompra) AS DECIMAL(10,2)) AS 'Venta Promedio'
  FROM Ordenes
  GROUP BY HorarioVenta
  ORDER BY 'Volumen de Ventas' DESC

  --TIEMPOS
  --Tiempo promedio de preparacion y entrega de domicilios
  SELECT 
	AVG(DATEDIFF (MINUTE, FechaOrdenTomada, FechaOrdenLista)) PromedioTiempoPreparacion,
	AVG(DATEDIFF (MINUTE, FechaDespacho, FechaEntrega)) PromedioTiempoEntrega 
FROM
	Ordenes
WHERE 
	MensajeroID IS NOT NULL;

--Vemtas totales y promedio de ventas por empleado


SELECT
	E.Nombre Empleado,
	COUNT(TotalCompra) Cantidad,
	CAST(AVG(TotalCompra) AS DECIMAL (10,2)) VolumenVentaPromedio,
	CAST(SUM(TotalCompra) AS DECIMAL (10,2)) VentaTotal
FROM
	Ordenes O
INNER JOIN
	Empleados E ON (O.EmpleadoID = E.EmpleadoID)
GROUP BY
	E.Nombre
ORDER BY
	VolumenVentaPromedio DESC;

--CLIENTES RECURRENTES

SELECT 
    COUNT(*) AS ClientesRecurrentes,
    CAST(ROUND((COUNT(*) * 100.0) / (SELECT COUNT(DISTINCT ClienteID) FROM Ordenes), 2) AS DECIMAL(10,2)) AS Porcentaje
FROM (
    SELECT ClienteID
    FROM Ordenes
    GROUP BY ClienteID
    HAVING COUNT(*) > 1
) AS ClientesRecurrentes;

--IMPLEMENTACION DE INDICES

--Crear un índice en la columna ClienteID:
CREATE INDEX idx_ClienteID ON Ordenes(ClienteID);

--Crear un índice en la columna EmpleadoID:
CREATE INDEX idx_EmpleadoID ON Ordenes(EmpleadoID);

--Crear un índice en la columna SucursalID:
CREATE INDEX idx_SucursalID ON Ordenes(SucursalID);

--Crear un índice en la columna MensajeroID:
CREATE INDEX idx_MensajeroID ON Ordenes(MensajeroID);

--Crear un índice en la columna TipoPagoID:
CREATE INDEX idx_TipoPagoID ON Ordenes(TipoPagoID);

--Crear un índice compuesto en las columnas FechaDespacho y FechaEntrega:

CREATE INDEX idx_FechaDespacho_Entrega ON Ordenes(FechaDespacho, FechaEntrega);